import { BrowserRouter } from 'react-router-dom';
import { Route, Routes } from 'react-router-dom';
import HomePage from './components/StartingPage/StartingPageContent';















function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<HomePage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
